import './TextWithHrLine.css'

export const TextWithHrLine = (props) => {
    const text = props?.data?.text;
  return (
    <div class="container">
      <div class="line"></div>
      <div class="text">
        <span>{text}</span>
      </div>
      <div class="line"></div>
    </div>
  );
};
